class Solution(object):
    def maxProduct(self, words):
        """
        :type words: List[str]
        :rtype: int
        """
        res = 0
        for word in words:
            dic = {}
            for i in word:
                if i not in dic:
                    dic[i] = 0
            
            for cword in words:
                flag = 1
                for j in cword:
                    if j in dic:
                        flag = 0
                        break
                if flag == 1:
                    res = max(res,len(word)*len(cword))
        return res

