class Solution(object):
    def maxProduct(self, words):
        """
        :type words: List[str]
        :rtype: int
        """
        dic={}

        for word in words:
            a = [0]*26
            l = set(word)
            for i in l:
                a[ord(i)-ord('a')] = 1
            dic[word] = a
        res = 0

        for word in words:
            for cword in words:
                flag = 1
                for i in xrange(26):
                    if dic[word][i] and dic[cword][i] :
                        flag = 0 
                        break
                if flag == 1:
                    res = max(res,len(word)*len(cword))

